import React,  { useState } from "react";
import ReactDOM from "react";

const App = () => {
    const [counter, setCounter] = useState(0)

    setTimeout(
        () => setCounter(counter + 1),
        1000
    )

    return(
        <div>{counter}</div>
    )
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
)
